import React from 'react';
import "./Login.css";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import HeadsetMicIcon from '@mui/icons-material/HeadsetMic';
import { Typography } from '@mui/material';

class Login extends React.Component{

    render(){


        return(
            <div className='Login'>
                    <HeadsetMicIcon sx={{
                                    fontSize: "2700%",
                                    padding: "3%",
                                    height: "40%",
                                    width: "23%",
                                    color: "rgb(62, 110, 155)",
                                    bgcolor: "rgb(147, 191, 233)",
                                    position: "fixed",
                                    top: "30%",
                                    left: "50%",
                                    transform: "translate(-50%, -50%)",
                                    borderRadius: "50%"
                                    }}
                    />

                <div className='centeredTitle'>
                    <Typography variant="h1" gutterBottom>
                        AMAZON RSH
                    </Typography>
                </div>

                <div className='centeredInputs'>
                    <Box
                        component="form"
                        sx={{
                            '& > :not(style)': { m: 1, width: '25ch' },
                        }}
                        noValidate
                        autoComplete="off">
                        <TextField label="User" color="primary" focused />
                    </Box>

                    <Box
                        component="form"
                        sx={{
                            '& > :not(style)': { m: 1, width: '25ch' },
                        }}
                        noValidate
                        autoComplete="off">
                        <TextField label="Password" color="secondary" focused />
                    </Box>
                </div>

                <div className='centeredButtons'>
                    <Stack spacing={2} direction="row">
                    <Button variant="outlined">Cancel</Button>
                    <Button onClick={event =>  window.location.href='/videos'} variant="contained" >Next</Button>      
                    </Stack>
                </div>
            </div> 


        );

    }

}

export default Login;
